const GetEmail = ()=>{

    const GetJSON = async ()=>{
        await fetch("http://192.168.1.247:3001/api/user/home")
        .then(response=>response.json())
        .then(response=>{
            console.log("test: ", response)
            return response
        })

    }   

    const readjson =async()=>{
        const a = await GetJSON()
        console.log("test3: ", await a)
    }

    readjson()

    // console.log("test2:", GetJSON())

    return(
        <h1>hello</h1>
    )
}

export default GetEmail
